from dataclasses import dataclass
from typing import TypedDict, Union

from stw_gen_sample3_api.basic_types import *
from stw_py_api_runtime.gen_classes.telemetry.parse import Message as _Message




@dataclass
class CrcInfo(_Message):

    # Размер загруженной части прошивки
    size: uint32_t
    # Контрольная сумма загруженной прошивки
    crc: uint32_t


class CrcInfoDict(TypedDict):

    # Размер загруженной части прошивки
    size: Union[uint32_t, int ]

    # Контрольная сумма загруженной прошивки
    crc: Union[uint32_t, int ]

